const Login = () => {
  return (
    <section className="login">
      <div className="form__container">
        <form className="form__user">
          <h2 className="form__title">Вход</h2>
          <input className="form__input" type="email" placeholder="Email" required></input>
          <span className="form__input-error input-title-error"></span>
          <input className="form__input" type="Пароль" placeholder="Email" required></input>
          <span className="form__input-error input-title-error"></span>
          <button className="form__button-submit">Войти</button>
        </form>
      </div>
    </section>
  );
};

export default Login;
